      value: '',
      data: {}
    }
  }


  handleChange = () => {
    var val = e.target.value;
    this.setState({
      value: val
    })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">

        <form>
        </form>

        </header>
      </div>
    );
  }
}

export default App;
